import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export default function LoginRestauranteTailwind() {
  const [email, setEmail]       = useState('');
  const [password, setPassword] = useState('');
  const [error, setError]       = useState('');
  const navigate                = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/restaurante/login', { email, password });

      const { token, restaurante_id, nombre } = response.data;

      if (!token) {
        throw new Error('Token inválido');
      }

      localStorage.setItem('token', token);
      localStorage.setItem('restaurante_id', restaurante_id.toString());
      localStorage.setItem('name', nombre);
      localStorage.setItem('email', email);

      setError('');
      toast.success('¡Inicio de sesión exitoso! Redirigiendo...');
      setTimeout(() => navigate('/restaurant-dashboard'), 2000);
    } catch (err) {
      console.error('Error en login:', err.response || err.message);
      const errorMessage = err.response?.data?.error || 'Credenciales inválidas';
      setError(errorMessage);
      toast.error(`Error: ${errorMessage}`);
    }
  };

  return (
    <>
      <ToastContainer />
      <div className="flex min-h-full flex-1 flex-col justify-center px-6 py-12 lg:px-8">
        <div className="sm:mx-auto sm:w-full sm:max-w-sm">
          <img
            alt="Your Company"
            src="https://tailwindcss.com/plus-assets/img/logos/mark.svg?color=indigo&shade=600"
            className="mx-auto h-10 w-auto"
          />
          <h2 className="mt-10 text-center text-2xl font-bold tracking-tight text-gray-900">
            Iniciar Sesión - Restaurante
          </h2>
          {error && <p className="mt-3 text-center text-red-600">{error}</p>}
        </div>
        <div className="mt-10 sm:mx-auto sm:w-full sm:max-w-sm">
          <form onSubmit={handleSubmit} className="space-y-6">
            <div>
              <label htmlFor="email" className="block text-sm font-medium text-gray-900">
                Correo Electrónico
              </label>
              <div className="mt-2">
                <input
                  id="email"
                  name="email"
                  type="email"
                  required
                  autoComplete="email"
                  className="block w-full rounded-md bg-white px-3 py-1.5 text-gray-900 
                             placeholder:text-gray-400 outline outline-1 outline-gray-300
                             focus:outline-2 focus:outline-indigo-600 sm:text-sm"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
              </div>
            </div>
            <div>
              <label htmlFor="password" className="block text-sm font-medium text-gray-900">
                Contraseña
              </label>
              <div className="mt-2">
                <input
                  id="password"
                  name="password"
                  type="password"
                  required
                  autoComplete="current-password"
                  className="block w-full rounded-md bg-white px-3 py-1.5 text-gray-900 
                             placeholder:text-gray-400 outline outline-1 outline-gray-300
                             focus:outline-2 focus:outline-indigo-600 sm:text-sm"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />
              </div>
            </div>
            <div>
              <button
                type="submit"
                className="flex w-full justify-center rounded-md bg-indigo-600 
                           px-3 py-1.5 text-sm font-semibold text-white shadow 
                           hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 
                           focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
              >
                Iniciar Sesión
              </button>
            </div>
          </form>
          <p className="mt-10 text-center text-sm text-gray-500">
            ¿Aún no tienes cuenta?{' '}
            <Link to="/registro-restaurante" className="font-semibold text-indigo-600 hover:text-indigo-500">
              Registrarse
            </Link>
          </p>
        </div>
      </div>
    </>
  );
}
